import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';

import './App.css';
import Login from './components/Login';

function App() {
  return (
    <Router>
      <div className="App">
        <Login />
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About Us</Link>
          </li>
        </ul>
        <Route exact path='/' component={Home}></Route>
        <Route exact path='/about' component={About}></Route>
      </div>
    </Router>
  );
}

export default App;
